def minPrefixesToFormTarget(words, target):
    from collections import defaultdict

    # Create a dictionary to store words and their lengths
    word_dict = defaultdict(list)
    for word in words:
        for i in range(1, len(word) + 1):
            word_dict[word[:i]].append(word)

    # Initialize the DP array
    dp = [float('inf')] * (len(target) + 1)
    dp[0] = 0

    # Fill the DP array
    for i in range(1, len(target) + 1):
        for prefix in word_dict:
            if i >= len(prefix) and target[i - len(prefix):i] == prefix:
                dp[i] = min(dp[i], dp[i - len(prefix)] + 1)

    # If dp[len(target)] is still inf, it means it's not possible to form the target
    return dp[len(target)] if dp[len(target)] != float('inf') else -1

